    return (
        <div className="home-container">
            <h1>Welcome to Snake Game</h1>
            <form onSubmit={handleSubmit}>
                <input 
                    type="text" 
                    placeholder="Enter your username" 
                    value={username}
                    onChange={(e) => setUsername(e.target.value)} 
                    required
                />
                <button type="submit">Start Game</button>
            </form>
        </div>
    );
};

export default Menu;
